export function add15(a: number, b: number): number {
  return a + b;
}

export function subtract15(a: number, b: number): number {
  return a - b;
}

export function multiply15(a: number, b: number): number {
  return a * b;
}

export function divide15(a: number, b: number): number {
  return a / b;
}
